@Injectable()
export class MockEpisysServerService {
	receiveMessages(serviceName: String, methodName: String, args: String, toolbar: Toolbar): Promise<Object> {
		return Promise.resolve({
			"$items":
				MESSAGES.$items.filter(this.getFilteredMessage(toolbar))
		})
	};

//		return Promise.resolve(MESSAGES);

	getFilteredMessage(toolbar: Toolbar) {
		var fromDate = new Date(toolbar.fromDate);
		var toDate = new Date(toolbar.toDate);

		return function(message: any) {
			// For example input message doesn't have PostDate property
			if (message["PostDate"] == undefined) {
				return true;
			}
			var pipe = new JhaDateStringPipe();
			var postDate = new Date(pipe.transform(message["PostDate"]));

			return postDate >= fromDate && postDate <= toDate;
		}
	}
}
